import Header from "./component/Header"
import Login from "./component/Login";
import { BrowserRouter as Router,Route,Switch} from 'react-router-dom'
import Lastpage from "./component/Lastpage";

function App() {
  function getDetails(mail){
    console.log(mail);
  }

  return (
    <Router>
      <div>
        <Header/>
        <switch>
          <Route exact path="/">
          <Login Detail = {getDetails}/>
          </Route>
          <Route path="/lastpage">
          <Lastpage/>
          </Route>
        </switch>
      </div>
    </Router>
  );
}

export default App;
